  \"Grassland breeding bird use of managed grasslands on National Wildlife Refuges
  in Region 5 of the Fish and Wildlife Service\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  5,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:44.033241\",\n\t\"name\": \"grassland-breeding-bird-use-of-managed-grasslands-on-national-wildlife-refuges-in-region-5\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The overall purpose of this project is
  to understand the likely capacity of Fish and Wildlife Service land managers to
  affect grassland bird populations in Region 5. This involved three components: 1)
  to establish information on grassland bird species distribution and habitat use
  to support decisions about regional priorities for management; 2) to determine how
  vegetation structure and composition affect grassland bird use and; 3) to determine,
  in turn, how the choice of dominant grass community (fallow field vs. planted warm
  season grass) and management technique (mow vs. burn) affect the vegetation structure
  and composition.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
